INSERT INTO `skpi` (`no`, `nim`, `nama`, `jurusan`, `cpl`, `indonesia`, `english`, `verifikasi1`, `verifikator1`, `tglverifikasi1`, `verifikasi2`, `verifikator2`, `tglverifikasi2`, `verifikasi3`, `verifikator3`, `tglverifikasi3`, `keterangan`) VALUES
	(160, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mendesain database management dan enterprise system untuk aplikasi industry. ', 'Student is able to design database management and enterprise system for industrial application.', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(161, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega, sejawat baik di dalam maupun di luar lembaganya. ', 'Able to maintain and develop networks with mentors, colleagues, peers both inside and outside the institution.', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(162, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu mendokumentasikan, menyimpan, mengamankan, dan menemukan kembali data untuk menjamin kesahihan dan mencegah plagiasi.', 'Able to document, store, secure, and recover data to ensure validity and prevent plagiarism.', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(163, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu menerapkan pemikiran logis, kritis, sistematis, dan inovatif dalam konteks pengembangan atau implementasiilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniorayang sesuai dengan keahlian.', 'Able to apply logical, critical, systematic, and innovative thinking in the context of developing or implementing science and technology that pays attention to and applies human values in accordance with expertise.', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(164, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di keahliannya di berdasarkan hasil analisis informasi dan data.', 'Able to make decisions appropriately in the context of problem solving in their expertise based on the results of information and data analysis.', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(165, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu menunjukkan kinerja mandiri, bermutu, dan terukur.', 'Able to demonstrate independent, quality and measurable performance', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(166, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu menyusun deskripsi saintifik hasil kajian tersebut di atas dalam bentuk skripsi atau laporan tugas akhir dan mengunggahnya dalam laman perguruan tinggi.', 'Able to compile a scientific description of the results of the above study in the form of a thesis or final project report and upload it on the college website', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(167, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa aplikasi konsep teoritis dari data structures & algorithms, computability & complexity, automata theory, object-oriented programming, functional programming, event-driven and reactive programming, concurrency and parallelism, programming languages, software development fundamentals, and web & mobile platforms.', 'Student is able to analyze the application of theoretical concept of data structures & algorithms, computability & complexity, automata theory, object-oriented programming, functional programming, event-driven and reactive programming, concurrency and parallelism, programming languages, software development fundamentals, and web & mobile platforms.', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(168, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa aplikasi konsep teoritis dari information management, database system design, data modelling & indexing, relational database, query language, transaction processing, distributed databases, information storage & retrieval, data mining, dan industrial system. ', 'Student is able to analyze the applications of theoretical concepts of information management, database system design, data modelling & indexing, relational database, query language, transaction processing, distributed databases, information storage & retrieval, data mining, and industrial system', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(169, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Sikap Khusus', 'Bekerja sama dan memiliki kepekaan sosial serta kepedulian terhadap masyarakat dan lingkungan.', 'Demonstrate capabilities of collaboration and having social sensitivity and concern for the community and the environment', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(170, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Sikap Khusus', 'Berkontribusi dalam peningkatan mutu kehidupan bermasyarakat, berbangsa, bernegara, dan kemajuan peradaban berdasarkan Pancasila.', 'Contribute to improve the quality of life of society, nation, state, and the advancement of civilization based on Pancasila', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(171, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Sikap Khusus', 'Berperan sebagai warga negara yang bangga dan cinta tanah air, memiliki nasionalisme serta rasa tanggung jawab pada negara dan bangsa.', 'Serves as a citizen that proud and love of the country, has nationalism and sense of responsibility to the state and nation.', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(172, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Sikap Khusus', 'Bertakwa kepada Tuhan Yang Maha Esa dan mampu menunjukkan sikap religius.', 'Obedient to God Almighty and demonstrate religious attitude.', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(173, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Sikap Khusus', 'Menjunjung tinggi nilai kemanusiaan dalam menjalankan tugas berdasarkan agama, moral, dan etika.', 'Uphold the value of humanity to perform duties based on religion, morals, and ethics', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(174, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Sikap Khusus', 'Menunjukkan sikap bertanggungjawab atas pekerjaan dibidang keahliannya secara mandiri.', 'Demonstrate responsible attitude towards the practice of the field of expertise', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(175, '16650101', 'FARRAH ARRAZY', 'Teknik Informatika', 'Sikap Khusus', 'Taat hukum dan disiplin dalam kehidupan bermasyarakat dan bernegara.', 'Obedient to the law and discipline in social life and state', 1, '65136', '2021-03-19', 1, '55022', '2021-03-19', 1, '63007', '2021-03-19', NULL),
	(260, '15640068', 'MUFLIKHATI FANI ROSADAH', 'Fisika', 'Kemampuan Kerja', 'Mampu memprediksi potensi penerapan model matematis dan model fisis dalam teknologi', 'Able to predict the potential application of mathematical models and of physical models in technology', 1, '64006', '2021-03-22', 1, '64002', '2021-03-22', 1, '63007', '2021-03-23', NULL),
	(261, '15640068', 'MUFLIKHATI FANI ROSADAH', 'Fisika', 'Kemampuan Kerja', 'Mampu mendiseminasikan hasil kajian masalah dari fenomena fisis dalam bentuk laporan atau karya ilmiah lain yang sesuai dengan kaidah ilmiah yang berlaku', 'Able to disseminate the study of the physical phenomenons result in a book report or other kind of scientific reports using the correct academic writing', 1, '64006', '2021-03-22', 1, '64002', '2021-03-22', 1, '63007', '2021-03-23', NULL),
	(262, '15640068', 'MUFLIKHATI FANI ROSADAH', 'Fisika', 'Kemampuan Kerja', 'Mampu menerapkan model matematis dan model fisis berdasarkan hipotesis atau asumsi awal  dan analisa dampak dari suatu fenomena terhadap subyek kajian', 'Able to apply either mathematical models or physical models which relevant with the hypothesis or the intial assumption and the predicted impact of the phenomena toward the subject of discussion.', 1, '64006', '2021-03-22', 1, '64002', '2021-03-22', 1, '63007', '2021-03-23', NULL),
