	(264, '15640068', 'MUFLIKHATI FANI ROSADAH', 'Fisika', 'Kemampuan Kerja', 'Mampu menyajikan solusi alternatif berkenaan permasalahan fisis serta menyimpulkannya sebagai dasar pengambilan keputusan yang tepat.', 'Able to provide the alternative solutions regarding the physical problems and the conclusion for taking the right decision', 1, '64006', '2021-03-22', 1, '64002', '2021-03-22', 1, '63007', '2021-03-23', NULL),
	(265, '15640068', 'MUFLIKHATI FANI ROSADAH', 'Fisika', 'Kemampuan Kerja', 'Mampu merumuskan gejala dan masalah fisis melalui analisis berdasarkan hasil observasi atau eksperimen', 'Able to formulate physical phenomenon and problems through analysis based on the result of observation and experiment', 1, '64006', '2021-03-22', 1, '64002', '2021-03-22', 1, '63007', '2021-03-23', NULL),
