	(267, '15640068', 'MUFLIKHATI FANI ROSADAH', 'Fisika', 'Penguasaan Pengetahuan', 'Memahami konsep-konsep, prinsip-prinsip dan aplikasi fisika klasik dan modern', 'Understand the concepts, principles, and applictions of classical physics and modern physics', 1, '64006', '2021-03-22', 1, '64002', '2021-03-22', 1, '63007', '2021-03-23', NULL),
