	(351, '16660116', 'FARIZAL ZAINUR ROZIKIN', 'Teknik Arsitektur', 'Kemampuan Kerja', 'A. Mampu memahami dasar-dasar persepsi visual dan ordering system dalam 2D, 3D, komposisi arsitektural, hingga rancang kota', 'A. Capable of understanding the basics of visual perception and ordering systems in 2D, 3D, architectural composition, to city design', 1, '66009', '2021-03-27', 1, '66009', '2021-03-27', 1, '63007', '2021-03-31', NULL),
	(352, '16660116', 'FARIZAL ZAINUR ROZIKIN', 'Teknik Arsitektur', 'Kemampuan Kerja', 'B. Cukup Mampu mengumpulkan berbagai data dan informasi serta menganalisis berbagai permasalahan dan potensi pada proses perancangan', 'B. Sufficiently able to collect data and information as well as analyzing problem related to design', 1, '66009', '2021-03-27', 1, '66009', '2021-03-27', 1, '63007', '2021-03-31', NULL),
