	(355, '16660116', 'FARIZAL ZAINUR ROZIKIN', 'Teknik Arsitektur', 'Kemampuan Kerja', 'E. Sangat mampu mengaplikasikan dan mengintegrasikan berbagai prinsip teknologi bangunan pada karya arsitektur ', 'E. Excellent in applying and integrating the principles building technology of an architectural design', 1, '66009', '2021-03-27', 1, '66009', '2021-03-27', 1, '63007', '2021-03-31', NULL),
