	(357, '16660116', 'FARIZAL ZAINUR ROZIKIN', 'Teknik Arsitektur', 'Kemampuan Kerja', 'G. Mampu menggunakan berbagai media untuk mengkomunikasikan hasil rancangan arsitektur, misalnya freehand, AutoCad, SketchUp, CorelDraw, Adobe Photoshop, dan lain-lain serta menguasai berbagai media komunikasi dan informasi', 'G. Capable of using media to communicate architectural design results (freehand, AutoCad, SketchUp, CorelDraw, Adobe Photoshop, and other media of communication and information)', 1, '66009', '2021-03-27', 1, '66009', '2021-03-27', 1, '63007', '2021-03-31', NULL),
