	(363, '16660116', 'FARIZAL ZAINUR ROZIKIN', 'Teknik Arsitektur', 'Penguasaan Pengetahuan', 'D. Mampu memahami prinsip, asas, dan metode perancangan arsitektur serta integrasi nilai Islam pada karya arsitektur', 'D. Capable of understanding the principles, principles and methods of architectural design as well as the integration of Islamic values in architectural works', 1, '66009', '2021-03-27', 1, '66009', '2021-03-27', 1, '63007', '2021-03-31', NULL),
