	(562, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mendesain rangkaian digital dan sistem microprosessor pada arsitektur komputer, IoT, dan robotika. ', 'Student is able to design a digital circuit and microprocessor system in a computer architecture, system IoT, and robotics.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(563, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mendesain software secara professional yang sesuai dengan kaidah Software Development Life Cycle dan memenuhi kebutuhan pengguna.', 'Student is able to design software based on professional ethic according to Software Development Life Cycle and to fulfil user needs.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(564, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mendesain visualisasi grafis, animasi, dan aplikasi game sesuai dengan kebutuhan pasar. ', 'Student is able to design graphical visualization, animation, and game application based on the market trend.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(565, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiwa mampu mendesain sistem keamanan, sistem terdistribusi, dan manajemen jaringan & server pada lingkup intranet & cloud. ', 'Student is able to design secure system, distributed system, and network & server management in intranet & cloud.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(566, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu bertanggungjawab atas pencapaian hasil kerja kelompok dan melakukan supervisi dan evaluasi terhadap penyelesaian pekerjaan yang ditugaskan kepada pekerja yang berada di bawah tanggungjawabnya.', 'Able to be responsible for the achievement of group work results and to supervise and evaluate the completion of work assigned to workers under their responsibility.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(567, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu melakukan proses evaluasi diri terhadap kelompok kerja yang berada dibawah tanggung jawabnya, dan mampu mengelola pembelajaran secara mandiri.', 'Able to carry out the self-evaluation process of the work group under their responsibility, and able to manage learning independently.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(568, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega, sejawat baik di dalam maupun di luar lembaganya. ', 'Able to maintain and develop networks with mentors, colleagues, peers both inside and outside the institution.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(569, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu mendokumentasikan, menyimpan, mengamankan, dan menemukan kembali data untuk menjamin kesahihan dan mencegah plagiasi.', 'Able to document, store, secure, and recover data to ensure validity and prevent plagiarism.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(570, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu menerapkan pemikiran logis, kritis, sistematis, dan inovatif dalam konteks pengembangan atau implementasiilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniorayang sesuai dengan keahlian.', 'Able to apply logical, critical, systematic, and innovative thinking in the context of developing or implementing science and technology that pays attention to and applies human values in accordance with expertise.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(571, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di keahliannya di berdasarkan hasil analisis informasi dan data.', 'Able to make decisions appropriately in the context of problem solving in their expertise based on the results of information and data analysis.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(572, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu mengkaji implikasi pengembangan atau implementasiilmu pengetahuan teknologi yang memperhatikan dan menerapkan nilai humaniora sesuai dengan keahliannya berdasarkan kaidah, tata cara dan etika ilmiah dalam rangka menghasilkan solusi, gagasan, desain atau kritik seni, menyusun deskripsi saintifik hasil kajiannya dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi; menyusun deskripsi saintifik hasil kajian tersebut di atas dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi.', 'Able to study the implications of developing or implementing scientific technology that pays attention to and applies humanities values according to their expertise based on scientific principles, procedures and ethics in order to produce solutions, ideas, designs or art criticism, compile a scientific description of the results of their studies in the form of a thesis or assignment report. end, and upload it on the college page; compile a scientific description of the results of the study above in the form of a thesis or final project report, and upload it on the college page.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(573, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu menunjukkan kinerja mandiri, bermutu, dan terukur.', 'Able to demonstrate independent, quality and measurable performance', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(574, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu menyusun deskripsi saintifik hasil kajian tersebut di atas dalam bentuk skripsi atau laporan tugas akhir dan mengunggahnya dalam laman perguruan tinggi.', 'Able to compile a scientific description of the results of the above study in the form of a thesis or final project report and upload it on the college website', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(575, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa aplikasi konsep teoritis dari aplikasi computer system fundamentals, modern operating system, computer network, distributed system, cloud computing dan system security.', 'Student is able to analyze the application of theoretical concept of computer system fundamentals, modern operating system, computer network, distributed system, cloud computing and system security', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
	(576, '16650049', 'NANDA AYU ISTIQOMAH', 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa aplikasi konsep teoritis dari data structures & algorithms, computability & complexity, automata theory, object-oriented programming, functional programming, event-driven and reactive programming, concurrency and parallelism, programming languages, software development fundamentals, and web & mobile platforms.', 'Student is able to analyze the application of theoretical concept of data structures & algorithms, computability & complexity, automata theory, object-oriented programming, functional programming, event-driven and reactive programming, concurrency and parallelism, programming languages, software development fundamentals, and web & mobile platforms.', 1, '65010', '2021-03-29', 1, '55022', '2021-03-29', 1, '63007', '2021-03-31', NULL),
