	(1456, '16610088', 'AMINAHTUZ ZAHRO', 'Matematika', 'Kemampuan Kerja', 'Mampu menyusun deskripsi saintifik hasil kajianya dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi', 'Able to develop scientific description of the results of a study which formed in a thesis or final report and upload it in the official website of their institution', 1, '61007', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1457, '16610088', 'AMINAHTUZ ZAHRO', 'Matematika', 'Penguasaan Pengetahuan', 'Mampu membangun konsep matematika analisis menggunakan metode-metode terkini dan menguasai software-software terbaru yang banyak digunakan sebagai alat bantu penyelesaian masalah matematika', 'Able to build the analytical mathematic concept using modern methods and mastering newest softwares as tools to solve mathematics problems', 1, '61007', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1458, '16610088', 'AMINAHTUZ ZAHRO', 'Matematika', 'Penguasaan Pengetahuan', 'Mampu membuat pernyataan benar (pola, sifat, dan teorema) dan dapat dibuktikan benar secara umum, serta dapat diaplikasikan dalam dunia nyata', 'Able to make true statements (patterns, properties, and theorems) and can be proved to be true in general as well as can be applied in reality', 1, '61007', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1459, '16610088', 'AMINAHTUZ ZAHRO', 'Matematika', 'Penguasaan Pengetahuan', 'Menguasai konsep tentang algoritma, penyelesaian masalah secara sistematis, representasi algoritma, serta teori untuk melakukan analisis kompleksitas suatu algoritma untuk memilih algoritma yang optimal.\r\na.	Menguasai bahasa pemrograman yang berkaitan dengan aplikasi web, beserta framework dan library yang mendukungnya, serta memahami konsep desain antar muka aplikasi,\r\nb.	Menguasai konsep basis data dan perancangan sistem informasi,\r\nc.	Menguasai prinsip dasar komputasi fuzzy untuk diimplementasikan ke dalam program,\r\n\r\nd.	Menguasai konsep dasar pengolahan data untuk mendapatkan pengetahuan dari kumpulan data di antaranya adalah jaringan syaraf tiruan, algoritma genetika, dan pohon keputusan,\r\ne.	Menguasai pemahaman untuk melakukan pengolahan data gambar dengan komputer', 'Competent in algorithm concepts, solving problem systematicaly, representing algorithm, and theory for complexity analyzing of an algorithm to determine the optimal algorithm. \r\na.	Competent in computational language associated with web-aplication, framework, and support library, and understanding the interface application,\r\nb.	Competent in basis data concept and designing information system, \r\nc.	Competent in basic principle of fuzzy computation to be implemented into a program, \r\nd.	Competent in basic concept of data processing to gain the knowledge from data set such as artificial neural network, genetic algorithm, and decision tree,\r\ne.	Competent in image processing', 1, '61007', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1460, '16610088', 'AMINAHTUZ ZAHRO', 'Matematika', 'Penguasaan Pengetahuan', 'Menguasai prinsip-prinsip dan teknik pengelolaan investasi dan risiko keuangan dengan baik.  \r\na.	Mampu menganalisa hukum-hukum ekonomi dengan baik,\r\nb.	Mampu menganalisa investasi keuangan dengan baik,\r\nc.	Mampu menganalisa risiko keuangan di bidang asuransi dengan baik', 'principles and techniques as well as financial risk well.\r\na.	Able to analyse economics laws well,\r\n\r\nb.	Able to analyse financial investation well,\r\nc.	Able to analyse financial risk in the scope of  insurance well', 1, '61007', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1461, '16610088', 'AMINAHTUZ ZAHRO', 'Matematika', 'Penguasaan Pengetahuan', 'Menguasai tahapan-tahapan pemodelan, solusi, dan interpretasinya.\r\na.	Mampu mengidentifikasi dan memformulasikan masalah dalam model matematika,\r\nb.	Mampu menyelesaikan model matematika yang telah dibangun menggunakan teknologi-teknologi modern,\r\nc.	Menguasai software-software terbaru yang banyak digunakan sebagai alat bantu untuk penyelesaian masalah matematika', 'Competent in modelling steps, solutions, and its interpretations.\r\na.	Able to identificate and formulate the problem in mathematics model,\r\nb.	Able to solve the mathematics model that has been built using modern technologies,\r\n\r\nc.	Competent in softwares commonly used to solve mathematics problem', 1, '61007', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1462, '16610088', 'AMINAHTUZ ZAHRO', 'Matematika', 'Penguasaan Pengetahuan', 'Menguasai teknik pengambilan kesimpulan dengan tingkat kepercayaan tertentu berdasarkan sampel dari populasi.\r\na.	Menguasai pemodelan statistik untuk prediksi,\r\nb.	Menguasai cara menggambarkan suatu fenomena tertentu dengan lebih sederhana melalui ukuran-ukuran statistik,\r\nc.	Menguasai teknik sampling dan survey untuk melakukan efisiensi biaya,\r\nd.	Menguasai  teknik peramalan untuk memprediksi masa mendatang,\r\ne.	Menguasai teknik untuk mengetahui faktor-faktor yang berhubungan dengan sebuah permasalahan', 'Competent in decision-making techniques with a certain level of confidence based on a sample of population.\r\na.	Competent in statistic modelling for prediction,\r\nb.	Competent in describing a certain fenomenon more simply through statistics measures,\r\n\r\nc.	Competent in sampling and survey for cost eficiency,\r\nd.	Competent in forecasting to predict the outcome,\r\ne.	Competent in technique to identify factors which are related to the problem', 1, '61007', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1463, '16610088', 'AMINAHTUZ ZAHRO', 'Matematika', 'Sikap Khusus', 'Bekerja sama dan memiliki kepekaan sosial serta kepedulian terhadap masyarakat dan lingkungan', 'Cooperating and having social empathy and caring to society and environment', 1, '61007', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1464, '16610088', 'AMINAHTUZ ZAHRO', 'Matematika', 'Sikap Khusus', 'Berkontribusi dalam peningkatan mutu kehidupan bermasyarakat, berbangsa, bernegara, dan kemajuan peradaban berdasarkan Pancasila', 'Contributing in progressing the quality of life of the people, nation, state and advancement of civilizations based on Pancasila', 1, '61007', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1465, '16610088', 'AMINAHTUZ ZAHRO', 'Matematika', 'Sikap Khusus', 'Berperan sebagai warga negara yang bangga dan cinta tanah air, memiliki nasionalisme serta rasa tanggungjawab pada negara dan bangsa', 'Engaging as a citizen who is proud and loves their country, having the nationalism and being responsible to their nation and state', 1, '61007', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
