	(1477, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Bidang Matematika Terapan: Mampu menganalisis fakta dan fenomena dan mentransformasikan dalam bentuk model matematika serta menganalisis solusi serta menginterpretasi', 'Applied Mathematics Field: Able to analyse the fact and fenomenon, transform them into a mathematics model, and solve the model  as well as interprete it', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1478, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Bidang statistik: Mampu merencanakan, mengumpulkan, menganalisis, menginterpretasi dan mempresentasikan data', 'Statistic Field: Able to plan, collect, analyze, and interprete the data', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1479, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Mampu bertanggung jawab atas pencapaian hasil kerja kelompok dan melakukan supervise dan evaluasi terhadap penyelesaian pekerjaan yang ditugaskan kepada pekerja yang berada di tanggung jawabnya', 'Able to be responsible for the achievement of the groupÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Â ÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€šÃ‚Â ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¾Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Â ÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Â ÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Â ÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1480, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Mampu melakukan proses evaluasi diri terhadap kelompok kerja yang berada di bawah tanggung jawabnya, dan mampu mengolah pembelajaran secara mandiri', 'Able to conduct the self-assessment process of the working group under their responsibility and able to manage self-learning', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1481, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega, dan sejawat baik di dalam maupun diluar lembaganya', 'Able to maintain and develop a network with supervisors, colleagues, and associates both inside and outside the institution', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1482, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Mampu mendokumentasikan, menyimpan, mengamankan, dan menemukan kembali data untuk menjamin kesahihan dan mencegah plagiasi', 'Able to record, store, secure, and rediscover the data to assure the validity and to prevent plagiarism', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1483, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Mampu menerapkan pemikiran logis, kritis, sitematis, dan inovatif dalam konteks pengembangan atau implementasi ilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniora yang sesuai dengan bidang keahlianya', 'Able to apply logical, critical, systematic, and innovative thinking in the context of development or  implementation of science and technology, which takes into an account and apply the humanistic values corresponding to their area of expertise', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1484, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil analisis informasi dan data', 'Able to take decisions precisely in context of problem solving within their area of expertise, which based on analyzing the information and data', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1485, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Mampu mengkaji implikasi pengetahuan atau implementasi ilmu pengetahuan, teknologi, yang memperhatikan dan menerapkan nilai humaniora sesuai dengan keahliannya berdasarkan kaidah, tata cara dan etika ilmiah dalam rangka menghasilkan solusi, gagasan desain atau kritik seni', 'Able to assess the implications of the development or implementation of science and technology which concerns and applies the humanistic value  corresponding to their area of expertise based on the rules, procedures, and scientific ethics in order to generate solutions, ideas, design or art criticism', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1486, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Mampu menunjukan kinerja mandiri, bermutu, dan terukur', 'Able to demonstrate independent, qualified, and measured performance', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1487, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Kemampuan Kerja', 'Mampu menyusun deskripsi saintifik hasil kajianya dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi', 'Able to develop scientific description of the results of a study which formed in a thesis or final report and upload it in the official website of their institution', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1488, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Penguasaan Pengetahuan', 'Mampu membangun konsep matematika analisis menggunakan metode-metode terkini dan menguasai software-software terbaru yang banyak digunakan sebagai alat bantu penyelesaian masalah matematika', 'Able to build the analytical mathematic concept using modern methods and mastering newest softwares as tools to solve mathematics problems', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1489, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Penguasaan Pengetahuan', 'Mampu membuat pernyataan benar (pola, sifat, dan teorema) dan dapat dibuktikan benar secara umum, serta dapat diaplikasikan dalam dunia nyata', 'Able to make true statements (patterns, properties, and theorems) and can be proved to be true in general as well as can be applied in reality', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1490, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Penguasaan Pengetahuan', 'Menguasai konsep tentang algoritma, penyelesaian masalah secara sistematis, representasi algoritma, serta teori untuk melakukan analisis kompleksitas suatu algoritma untuk memilih algoritma yang optimal.\r\na.	Menguasai bahasa pemrograman yang berkaitan dengan aplikasi web, beserta framework dan library yang mendukungnya, serta memahami konsep desain antar muka aplikasi,\r\nb.	Menguasai konsep basis data dan perancangan sistem informasi,\r\nc.	Menguasai prinsip dasar komputasi fuzzy untuk diimplementasikan ke dalam program,\r\n\r\nd.	Menguasai konsep dasar pengolahan data untuk mendapatkan pengetahuan dari kumpulan data di antaranya adalah jaringan syaraf tiruan, algoritma genetika, dan pohon keputusan,\r\ne.	Menguasai pemahaman untuk melakukan pengolahan data gambar dengan komputer', 'Competent in algorithm concepts, solving problem systematicaly, representing algorithm, and theory for complexity analyzing of an algorithm to determine the optimal algorithm. \r\na.	Competent in computational language associated with web-aplication, framework, and support library, and understanding the interface application,\r\nb.	Competent in basis data concept and designing information system, \r\nc.	Competent in basic principle of fuzzy computation to be implemented into a program, \r\nd.	Competent in basic concept of data processing to gain the knowledge from data set such as artificial neural network, genetic algorithm, and decision tree,\r\ne.	Competent in image processing', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1491, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Penguasaan Pengetahuan', 'Menguasai prinsip-prinsip dan teknik pengelolaan investasi dan risiko keuangan dengan baik.  \r\na.	Mampu menganalisa hukum-hukum ekonomi dengan baik,\r\nb.	Mampu menganalisa investasi keuangan dengan baik,\r\nc.	Mampu menganalisa risiko keuangan di bidang asuransi dengan baik', 'principles and techniques as well as financial risk well.\r\na.	Able to analyse economics laws well,\r\n\r\nb.	Able to analyse financial investation well,\r\nc.	Able to analyse financial risk in the scope of  insurance well', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1492, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Penguasaan Pengetahuan', 'Menguasai tahapan-tahapan pemodelan, solusi, dan interpretasinya.\r\na.	Mampu mengidentifikasi dan memformulasikan masalah dalam model matematika,\r\nb.	Mampu menyelesaikan model matematika yang telah dibangun menggunakan teknologi-teknologi modern,\r\nc.	Menguasai software-software terbaru yang banyak digunakan sebagai alat bantu untuk penyelesaian masalah matematika', 'Competent in modelling steps, solutions, and its interpretations.\r\na.	Able to identificate and formulate the problem in mathematics model,\r\nb.	Able to solve the mathematics model that has been built using modern technologies,\r\n\r\nc.	Competent in softwares commonly used to solve mathematics problem', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1493, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Penguasaan Pengetahuan', 'Menguasai teknik pengambilan kesimpulan dengan tingkat kepercayaan tertentu berdasarkan sampel dari populasi.\r\na.	Menguasai pemodelan statistik untuk prediksi,\r\nb.	Menguasai cara menggambarkan suatu fenomena tertentu dengan lebih sederhana melalui ukuran-ukuran statistik,\r\nc.	Menguasai teknik sampling dan survey untuk melakukan efisiensi biaya,\r\nd.	Menguasai  teknik peramalan untuk memprediksi masa mendatang,\r\ne.	Menguasai teknik untuk mengetahui faktor-faktor yang berhubungan dengan sebuah permasalahan', 'Competent in decision-making techniques with a certain level of confidence based on a sample of population.\r\na.	Competent in statistic modelling for prediction,\r\nb.	Competent in describing a certain fenomenon more simply through statistics measures,\r\n\r\nc.	Competent in sampling and survey for cost eficiency,\r\nd.	Competent in forecasting to predict the outcome,\r\ne.	Competent in technique to identify factors which are related to the problem', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
	(1494, '16610105', 'A`YUNINA FAIDATUL NUZULA', 'Matematika', 'Sikap Khusus', 'Bekerja sama dan memiliki kepekaan sosial serta kepedulian terhadap masyarakat dan lingkungan', 'Cooperating and having social empathy and caring to society and environment', 1, '61025', '2021-04-09', 1, '61005', '2021-04-09', 1, '63007', '2021-04-12', NULL),
