	(1707, '13610014', 'JAUHAROH MAULIDIYAH', 'Matematika', 'Kemampuan Kerja', 'Bidang Matematika Terapan: Mampu menganalisis fakta dan fenomena dan mentransformasikan dalam bentuk model matematika serta menganalisis solusi serta menginterpretasi', 'Applied Mathematics Field: Able to analyse the fact and fenomenon, transform them into a mathematics model, and solve the model  as well as interprete it', 1, '61002', '2021-04-18', 1, '61005', '2021-04-18', 1, '63007', '2021-04-20', NULL),
