	(2263, '16610072', 'YASMINE RAMADHANTY ARIFIANTO', 'Matematika', 'Kemampuan Kerja', 'Mampu mendokumentasikan, menyimpan, mengamankan, dan menemukan kembali data untuk menjamin kesahihan dan mencegah plagiasi', 'Able to record, store, secure, and rediscover the data to assure the validity and to prevent plagiarism', 1, '61008', '2021-04-29', 1, '61005', '2021-04-29', 1, '63007', '2021-04-30', NULL),
	(2264, '16610072', 'YASMINE RAMADHANTY ARIFIANTO', 'Matematika', 'Kemampuan Kerja', 'Mampu menerapkan pemikiran logis, kritis, sitematis, dan inovatif dalam konteks pengembangan atau implementasi ilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniora yang sesuai dengan bidang keahlianya', 'Able to apply logical, critical, systematic, and innovative thinking in the context of development or  implementation of science and technology, which takes into an account and apply the humanistic values corresponding to their area of expertise', 1, '61008', '2021-04-29', 1, '61005', '2021-04-29', 1, '63007', '2021-04-30', NULL),
	(2265, '16610072', 'YASMINE RAMADHANTY ARIFIANTO', 'Matematika', 'Kemampuan Kerja', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil analisis informasi dan data', 'Able to take decisions precisely in context of problem solving within their area of expertise, which based on analyzing the information and data', 1, '61008', '2021-04-29', 1, '61005', '2021-04-29', 1, '63007', '2021-04-30', NULL),
	(2266, '16610072', 'YASMINE RAMADHANTY ARIFIANTO', 'Matematika', 'Kemampuan Kerja', 'Mampu mengkaji implikasi pengetahuan atau implementasi ilmu pengetahuan, teknologi, yang memperhatikan dan menerapkan nilai humaniora sesuai dengan keahliannya berdasarkan kaidah, tata cara dan etika ilmiah dalam rangka menghasilkan solusi, gagasan desain atau kritik seni', 'Able to assess the implications of the development or implementation of science and technology which concerns and applies the humanistic value  corresponding to their area of expertise based on the rules, procedures, and scientific ethics in order to generate solutions, ideas, design or art criticism', 1, '61008', '2021-04-29', 1, '61005', '2021-04-29', 1, '63007', '2021-04-30', NULL),
