INSERT INTO `skpi_cpl` (`no`, `jurusan`, `cpl`, `indonesia`, `english`, `def`) VALUES
	(15, 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu menerapkan pemikiran logis, kritis, sistematis, dan inovatif dalam konteks pengembangan atau implementasiilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniorayang sesuai dengan keahlian.', 'Able to apply logical, critical, systematic, and innovative thinking in the context of developing or implementing science and technology that pays attention to and applies human values in accordance with expertise.', 2),
	(16, 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa aplikasi konsep teoritis dari data structures & algorithms, computability & complexity, automata theory, object-oriented programming, functional programming, event-driven and reactive programming, concurrency and parallelism, programming languages, software development fundamentals, and web & mobile platforms.', 'Student is able to analyze the application of theoretical concept of data structures & algorithms, computability & complexity, automata theory, object-oriented programming, functional programming, event-driven and reactive programming, concurrency and parallelism, programming languages, software development fundamentals, and web & mobile platforms.', 2),
	(17, 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu menunjukkan kinerja mandiri, bermutu, dan terukur.', 'Able to demonstrate independent, quality and measurable performance', 2),
	(18, 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu mengkaji implikasi pengembangan atau implementasiilmu pengetahuan teknologi yang memperhatikan dan menerapkan nilai humaniora sesuai dengan keahliannya berdasarkan kaidah, tata cara dan etika ilmiah dalam rangka menghasilkan solusi, gagasan, desain atau kritik seni, menyusun deskripsi saintifik hasil kajiannya dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi; menyusun deskripsi saintifik hasil kajian tersebut di atas dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi.', 'Able to study the implications of developing or implementing scientific technology that pays attention to and applies humanities values according to their expertise based on scientific principles, procedures and ethics in order to produce solutions, ideas, designs or art criticism, compile a scientific description of the results of their studies in the form of a thesis or assignment report. end, and upload it on the college page; compile a scientific description of the results of the study above in the form of a thesis or final project report, and upload it on the college page.', 2),
	(19, 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu menyusun deskripsi saintifik hasil kajian tersebut di atas dalam bentuk skripsi atau laporan tugas akhir dan mengunggahnya dalam laman perguruan tinggi.', 'Able to compile a scientific description of the results of the above study in the form of a thesis or final project report and upload it on the college website', 2),
	(20, 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di keahliannya di berdasarkan hasil analisis informasi dan data.', 'Able to make decisions appropriately in the context of problem solving in their expertise based on the results of information and data analysis.', 2),
	(21, 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega, sejawat baik di dalam maupun di luar lembaganya. ', 'Able to maintain and develop networks with mentors, colleagues, peers both inside and outside the institution.', 2),
	(22, 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu bertanggungjawab atas pencapaian hasil kerja kelompok dan melakukan supervisi dan evaluasi terhadap penyelesaian pekerjaan yang ditugaskan kepada pekerja yang berada di bawah tanggungjawabnya.', 'Able to be responsible for the achievement of group work results and to supervise and evaluate the completion of work assigned to workers under their responsibility.', 2),
	(23, 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu melakukan proses evaluasi diri terhadap kelompok kerja yang berada dibawah tanggung jawabnya, dan mampu mengelola pembelajaran secara mandiri.', 'Able to carry out the self-evaluation process of the work group under their responsibility, and able to manage learning independently.', 2),
	(24, 'Teknik Informatika', 'Kemampuan Kerja', 'Mampu mendokumentasikan, menyimpan, mengamankan, dan menemukan kembali data untuk menjamin kesahihan dan mencegah plagiasi.', 'Able to document, store, secure, and recover data to ensure validity and prevent plagiarism.', 2),
	(25, 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mendesain algoritma yang memiliki kompleksitas rendah untuk aplikasi multiplatform. ', 'Student is able to design a low complexity algorithm for multiplatform application', 2),
	(26, 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mendesain metode analisis data dan algoritma cerdas yang efektif & efisien', 'Student is able to design an effective & efficient data analysis and intelligent algorithm.', 2),
	(27, 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mendesain software secara professional yang sesuai dengan kaidah Software Development Life Cycle dan memenuhi kebutuhan pengguna.', 'Student is able to design software based on professional ethic according to Software Development Life Cycle and to fulfil user needs.', 2),
	(28, 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mendesain database management dan enterprise system untuk aplikasi industry. ', 'Student is able to design database management and enterprise system for industrial application.', 2),
	(29, 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiwa mampu mendesain sistem keamanan, sistem terdistribusi, dan manajemen jaringan & server pada lingkup intranet & cloud. ', 'Student is able to design secure system, distributed system, and network & server management in intranet & cloud.', 2),
	(30, 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mendesain visualisasi grafis, animasi, dan aplikasi game sesuai dengan kebutuhan pasar. ', 'Student is able to design graphical visualization, animation, and game application based on the market trend.', 2),
	(31, 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mendesain rangkaian digital dan sistem microprosessor pada arsitektur komputer, IoT, dan robotika. ', 'Student is able to design a digital circuit and microprocessor system in a computer architecture, system IoT, and robotics.', 2),
	(32, 'Teknik Informatika', 'Kemampuan Kerja', 'Mahasiswa mampu mengaplikasikan metodologi penelitian yang terinspirasi dari Al-Qur\'an', 'Student is able to apply research methodologies inspired by the Al-Qur\'an and Hadits in solving scientific problems.', 2),
	(33, 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa aplikasi konsep teoritis dari discrete structures, search & heuristics, knowledge representation & reasoning, statistical & probabilistic inference, machine learning, modelling & simulation, uncertainty, natural language processing, and perception & vision.', 'Student is able to analyze the applications of theoretical concepts of discrete structures, search & heuristics, knowledge representation & reasoning, statistical & probabilistic inference, machine learning, modelling & simulation, uncertainty, natural language processing, and perception & vision.', 2),
	(34, 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa aplikasi konsep teoritis dari Software Processes, Requirement Engineering, Software Design & Construction, Verification & Validation, Evolution, Reliability, User-Centered Design, Professional Ethics, intellectual property, dan Project Management.', 'Student is able to analyze the application of theoretical concept of Software Processes, Requirement Engineering, Software Design & Construction, Verification & Validation, Evolution, Reliability, User-Centered Design, Professional Ethics, intellectual property, and Project Management.', 2),
	(35, 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa aplikasi konsep teoritis dari information management, database system design, data modelling & indexing, relational database, query language, transaction processing, distributed databases, information storage & retrieval, data mining, dan industrial system. ', 'Student is able to analyze the applications of theoretical concepts of information management, database system design, data modelling & indexing, relational database, query language, transaction processing, distributed databases, information storage & retrieval, data mining, and industrial system', 2),
	(36, 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa aplikasi konsep teoritis dari aplikasi computer system fundamentals, modern operating system, computer network, distributed system, cloud computing dan system security.', 'Student is able to analyze the application of theoretical concept of computer system fundamentals, modern operating system, computer network, distributed system, cloud computing and system security', 2),
