	(38, 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa aplikasi konsep teoritis dari digital system, representation of data, machine organization, memory system, interfacing and communication, multiprocessing, performance enhancements, computational paradigm, state and state machines.', 'Student is able to analyze the applications of theoretical concepts of digital system, representation of data, machine organization, memory system, interfacing and communication, multiprocessing, performance enhancements, computational paradigm, state and state machines.', 2),
	(39, 'Teknik Informatika', 'Penguasaan Pengetahuan', 'Mahasiswa mampu menganalisa penerapan metodologi penelitian dan nilai-nilai Al-Qur\'an', 'Student is able to analyze the application of research methodologies and the values of the Qur\'an and Hadits in solving scientific problems.', 2),
	(40, 'Teknik Informatika', 'Sikap Khusus', 'Bertakwa kepada Tuhan Yang Maha Esa dan mampu menunjukkan sikap religius.', 'Obedient to God Almighty and demonstrate religious attitude.', 2),
