	(51, 'Biologi', 'Kemampuan Kerja', 'Mampu melakukan praktek laboratorium dan kerja lapangan secara mandiri maupun kelompok menggunakan metodologi terstandart dalam bidang biologi', 'Being able to do laboratory practice and field work independently or in groups using standardized methodologies in the field of biology', 1),
	(52, 'Biologi', 'Kemampuan Kerja', 'Menunjukkan keterampilan komunikasi lisan dan tulisan yang efektif, dalam Bahasa Indonesia dan bahasa asing Inggris/Arab', 'Demonstrating effective oral and written communication skills, in Indonesian and foreign languages ', 1),
	(53, 'Biologi', 'Kemampuan Kerja', 'Mampu melakukan penelitian penuh yang mencakup desain penelitian; pengumpulan data, analisis dan interpretasi data kuantitatif; dan diseminasi hasil baik secara nasional ataupun internasional', 'Being able to conduct full research that includes research designs; data collection, analysis and interpretation of quantitative data; and national or international publication of research results ', 1),
	(54, 'Biologi', 'Penguasaan Pengetahuan', 'Menguasai konsep dan prinsip-prinsip biologi, pada tingkat molekuler, seluler, organisme, ekologi dan integrasinya dalam aspek keilmuan dan ke Islaman', 'Mastering the concepts and principles of biology at the molecular, cellular, organism, and ecology level and their integrations in the scientific and Islamic aspects', 1),
	(56, 'Biologi', 'Sikap Khusus', 'Mampu mengaplikasikan biopreneurship yang sesuai dengan nilai keislaman', 'Being able to apply biopreneurship in accordance with Islamic values', 1),
