	(63, 'Fisika', 'Kemampuan Kerja', 'Mampu mendiseminasikan hasil kajian masalah dari fenomena fisis dalam bentuk laporan atau karya ilmiah lain yang sesuai dengan kaidah ilmiah yang berlaku', 'Able to disseminate the study of the physical phenomenons result in a book report or other kind of scientific reports using the correct academic writing', 1),
