	(68, 'Fisika', 'Sikap Khusus', 'Mampu mengkomunikasikan hasil karya ilmiah baik lisan dan tertulis baik secara individu atau kelompok kepada masyarakat atau elemen terkait', 'Able to communicate both the oral and the written scientific work both individually or in the group to society or specific community', 1),
	(69, 'Fisika', 'Sikap Khusus', 'Memiliki sikap kepemimpinan, kreatifitas dan kemampuan komunikasi sebagai bekal dalam memberikan solusi alternatif baik dalam lingkungan akademik, organisasi, dan masyarakat umum', 'Own the leadership attitude, creativity, and communication ability as the basis for offering the alternative solutions both in academics environtment, organization, and social community', 1),
	(70, 'Biologi', 'Sikap Khusus', 'Memiliki sikap relijius dan nasionalis sebagai ilmuan muslim berdasarkan nilai-nilai dalam islam, pancasila dan UUD 1945', 'Having religious and nationalist attitudes as Muslim scientists based on values in Islam, Five Principles (Pancasila), and the 1945 Constitution', 1),
	(71, 'Matematika', 'Kemampuan Kerja', 'Mampu menerapkan pemikiran logis, kritis, sitematis, dan inovatif dalam konteks pengembangan atau implementasi ilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniora yang sesuai dengan bidang keahlianya', 'Able to apply logical, critical, systematic, and innovative thinking in the context of development or  implementation of science and technology, which takes into an account and apply the humanistic values corresponding to their area of expertise', 1),
