	(73, 'Matematika', 'Kemampuan Kerja', 'Mampu mengkaji implikasi pengetahuan atau implementasi ilmu pengetahuan, teknologi, yang memperhatikan dan menerapkan nilai humaniora sesuai dengan keahliannya berdasarkan kaidah, tata cara dan etika ilmiah dalam rangka menghasilkan solusi, gagasan desain atau kritik seni', 'Able to assess the implications of the development or implementation of science and technology which concerns and applies the humanistic value  corresponding to their area of expertise based on the rules, procedures, and scientific ethics in order to generate solutions, ideas, design or art criticism', 1),
	(74, 'Matematika', 'Kemampuan Kerja', 'Mampu menyusun deskripsi saintifik hasil kajianya dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi', 'Able to develop scientific description of the results of a study which formed in a thesis or final report and upload it in the official website of their institution', 1),
	(75, 'Matematika', 'Kemampuan Kerja', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil analisis informasi dan data', 'Able to take decisions precisely in context of problem solving within their area of expertise, which based on analyzing the information and data', 1),
	(76, 'Matematika', 'Kemampuan Kerja', 'Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega, dan sejawat baik di dalam maupun diluar lembaganya', 'Able to maintain and develop a network with supervisors, colleagues, and associates both inside and outside the institution', 1),
	(77, 'Matematika', 'Kemampuan Kerja', 'Mampu bertanggung jawab atas pencapaian hasil kerja kelompok dan melakukan supervise dan evaluasi terhadap penyelesaian pekerjaan yang ditugaskan kepada pekerja yang berada di tanggung jawabnya', 'Able to be responsible for the achievement of the groupÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Â ÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€šÃ‚Â ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¾Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Â ÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Â ÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Â ÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â', 1),
	(78, 'Matematika', 'Kemampuan Kerja', 'Mampu melakukan proses evaluasi diri terhadap kelompok kerja yang berada di bawah tanggung jawabnya, dan mampu mengolah pembelajaran secara mandiri', 'Able to conduct the self-assessment process of the working group under their responsibility and able to manage self-learning', 1),
	(79, 'Matematika', 'Kemampuan Kerja', 'Mampu mendokumentasikan, menyimpan, mengamankan, dan menemukan kembali data untuk menjamin kesahihan dan mencegah plagiasi', 'Able to record, store, secure, and rediscover the data to assure the validity and to prevent plagiarism', 1),
	(81, 'Matematika', 'Kemampuan Kerja', 'Bidang statistik: Mampu merencanakan, mengumpulkan, menganalisis, menginterpretasi dan mempresentasikan data', 'Statistic Field: Able to plan, collect, analyze, and interprete the data', 0),
	(82, 'Matematika', 'Kemampuan Kerja', 'Bidang Matematika Terapan: Mampu menganalisis fakta dan fenomena dan mentransformasikan dalam bentuk model matematika serta menganalisis solusi serta menginterpretasi', 'Applied Mathematics Field: Able to analyse the fact and fenomenon, transform them into a mathematics model, and solve the model  as well as interprete it', 0),
	(83, 'Matematika', 'Kemampuan Kerja', 'Bidang aktuaria: Mampu merencanakan, menganalisa, dan mengelola risiko keuangan di bidang bisnis, perbankan, dan asuransi dengan baik dan benar', 'Actuaria Field: Able to plan, analyse, and manage financial risk in business, banking, and insurance well and correctly', 0),
