	(351, 'Kimia', 'Kemampuan Kerja', 'Mampu memecahkan masalah IPTEK di bidang kimia yang umum dan dalam lingkup sederhana seperti identifikasi, analisis, isolasi, transformasi dan sintesis mikromolekul melalui penerapan pengetahuan umum, sifat, perubahan molekul (energi maupun kinetikanya), metode analisis dan sintesis pada bidang kimia spesifik serta penerapan teknologi yang relevan;\r\nA.	Mampu mengkaji dan menyelesaikan masalah-masalah kualitatif dan kuantitatif dalam sains kimia, baik secara individual maupun kelompok\r\nB.	Mampu mengkaji dan menyelesaikan masalah IPTEK melalui pendekatan sifat, perubahan unsur dan molekul (energi maupun kinetikanya) dengan metode identifikasi dan analisis yang benar\r\n', 'Able to solve problems about science and technology in chemistry field : in general or simple scope, such as identification, analysis, isolation, transformation, and micromolecules synthesis through applying general knowledge, molecule transformation (energy and kinetics), analysis method and synthesis in specific chemistry, then apply into relevant technologies\r\nA.	Able to review and solve problems qualitatively and quantitatively in chemistry, either individual or in group\r\nB.	Able to review and solve science and technology problems through properties, element transformation and molecule (energy and kinetics) approach using correct identification methods and analysis.', 1),
	(352, 'Kimia', 'Kemampuan Kerja', 'Mampu melakukan analisis terhadap berbagai alternatif solusi di bidang identifikasi, analisis, isolasi, transformasi dan sintesis bahan kimia yang tersedia dan menyajikan simpulan analisis untuk pengambilan keputusan yang tepat', 'Able to analysis alternative solution for identification, analysis, isolation, transformation and chemical synthesis, then conclude it for taking decision precisely\r\n\r\n', 1),
