	(377, 'Kimia', 'Sikap Khusus', 'Berkontribusi dalam peningkatan mutu kehidupan bermasyarakat, berbangsa, bernegara, dan kemajuan peradaban berdasarkan Pancasila', 'Contribute in progressing the quality in social, nations, state living and advancement civilizations based on Pancasila ', 1),
	(378, 'Kimia', 'Sikap Khusus', 'Berperan sebagai warga negara yang bangga dan cinta tanah air, memiliki nasionalisme serta rasa tanggungjawab pada negara dan bangsa', 'Act as a citizen who proud their nation and love their country, has nationalism and responsible to their nation and state', 1),
	(379, 'Kimia', 'Sikap Khusus', 'Menghargai keanekaragaman budaya, pandangan, agama, dan kepercayaan, serta pendapat atau temuan orisinal orang lain;\r\n\r\n', 'Respect the diversity of culture, views, religions and beliefs and also opinion and original invention of others\r\n\r\n', 1),
	(380, 'Kimia', 'Sikap Khusus', 'Bekerja sama dan memiliki kepekaan sosial serta kepedulian terhadap masyarakat dan lingkungan', 'Cooperation and has social empathy and care to society and environment', 1),
	(381, 'Kimia', 'Kemampuan Kerja', 'Taat hukum dan disiplin dalam kehidupan bermasyarakat dan bernegara', 'Obey the law and discipline in social and nation living', 1),
	(382, 'Kimia', 'Sikap Khusus', 'Menginternalisasi nilai, norma, dan etika akademik\r\n\r\n', 'Integrates the academic value, norms and ethics ', 1),
	(383, 'Kimia', 'Sikap Khusus', 'Menunjukkan sikap bertanggungjawab atas pekerjaan dibidang keahliannya secara mandiri', 'Shows responsible in works as their experts independently ', 1),
	(384, 'Kimia', 'Sikap Khusus', 'Menginternalisasi semangat kemandirian, kejuangan, dan kewirausahaan', 'Internalize spirit of independent, struggling and entrepreneurship', 1),
	(385, 'Kimia', 'Sikap Khusus', 'Taat hukum dan disiplin dalam kehidupan bermasyarakat dan bernegara', 'Obey the law and discipline in social and nation living', 1),
	(386, 'Kimia', 'Kemampuan Kerja', 'Mampu menerapkan pemikiran logis, kritis, sitematis, dan inovatif dalam konteks pengembangan atau implementasi ilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniora yang sesuai dengan bidang keahlianya.', 'Ability to apply a logical thinking, a criticality, a systematic, and an innovative in a context of a development or an implementation of science and technology, which takes into an account and an application of appropriate humanity values with areas of expertise. ', 0),
	(387, 'Kimia', 'Kemampuan Kerja', 'Mampu menunjukan kinerja mandiri, bermutu, dan terukur.', 'Ability to demonstrate a performance of independent, qualified, and measurable.', 0),
	(388, 'Kimia', 'Kemampuan Kerja', 'Mampu mengkaji implikasi pengetahuan atau implementasi ilmu pengetahuan, teknologi, yang memperhatikan dan menerapkan nilai humaniora sesuai dengan keahliannya berdasarkan kaidah, tata cara dan etika ilmiah dalam rangka menghasilkan solusi, gagasan desain atau kritik seni, ', 'Ability to examine the implication of development or implementation of knowledge and technology, which concern and apply value of humanities in according their expertise based on scientific principles, methods and ethics in order to generate solutions, ideas, design or art criticism. Moreover, scientific descriptions could be generated into thesis or final report and being uploaded in an official website of their institution.', 0),
	(389, 'Kimia', 'Kemampuan Kerja', 'Menyusun deskripsi saintifik hasil kajianya dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi.', 'Ability to arrange descriptions of scientific results of a study that mentioned above in a minor thesis or final report and being uploaded in an official website of their institution.', 0),
	(390, 'Kimia', 'Kemampuan Kerja', 'Menyusun deskripsi saintifik hasil kajian tersebut di atas dalam bentuk skripsi atau laporan tugas akhir, dan mengunggah dalam laman perguruan tinggi.', 'Ability to take decisions precisely in context of problem solving in their field expertise, which based on analyzing information and data', 0),
	(391, 'Kimia', 'Kemampuan Kerja', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil analisi/ informasi dan data.', 'Ability to maintain and develop a network with supervisors, colleagues, associates within and outside the institution.', 0),
	(392, 'Kimia', 'Kemampuan Kerja', 'Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega, sejawat baik di dalam maupun diluar lembaganya.', 'Ability to take responsible of attainment the result of working group, supervising and evaluating in finishing the works in their duty and the worker under his/her responsibilities', 0),
	(393, 'Kimia', 'Kemampuan Kerja', 'Mampu bertanggung jawab atas pencapaian hasil kerja kelompok dan melakukan supervise dan evaluasi terhadap penyelesaian pekerjaan yang ditugaskan kepada pekerja yang berada di tanggung jawabnya', 'Ability for being responsible for achievements of group work and supervision as well as evaluation and completion from task that assigned under his responsibility.', 0),
	(394, 'Kimia', 'Kemampuan Kerja', 'Mampu melakukan proses evaluasi diri terhadap kelompok kerja yang berada di bawah tanggung jawabnya, dan mampu mengolah pembelajaran secara mandiri', 'Ability to process self-assessment for working group under their responsibility and ability to manage lessons independently', 0),
	(395, 'Kimia', 'Kemampuan Kerja', 'Mampu mendokumentasikan, menyimpan, mengamankan, dan menemukan kembali data untuk menjamin kesahihan dan mencegah plagiasi.', 'Ability to record, save, secure and recover the data for assuring the validity and prohibiting plagiarism', 0);
